// Colors
$blue: #313a3d;
$orange: #fd9638;
$dark-orange: darken($orange, 20%);
$grey: #b6b6b6;
$light-grey: lighten($grey, 15%);

$background: #efefef;
$field-color: #e8e9ea;

body {
	background: $background;
	font-size: 62.5%;
	@include lato-3;
	color: $grey;

	section {
		background: white;
		margin: 60px auto 120px;
		border-top: 15px solid $blue;
		text-align: center;
		padding: 50px 0 110px;
		width: 80%;
		max-width: 1100px;

		h1 {
			margin-bottom: 40px;
			font-size: 4em;
			text-transform: uppercase;
			@include lato-1;
		}
	}
}

// Form
form {
	@include grid(7);

	.field {
		width: 100%;
		position: relative;
		margin-bottom: 15px;

		$hover-label-width: 18%;
		$placeholder-bumper: 1.5%;
		$label-padding: 18px;

		// Label
		label {
			text-transform: uppercase;
			position: absolute;
			top: 0;
			left: 0;
			background: $blue;
			width: 100%;
			padding: ($label-padding + 0px) 0;
			font-size: 1.45em;
			letter-spacing: 0.075em;

			@include ease(333ms);

			// Checkmark
			+ span {
				font-family: "SSStandard";
				opacity: 0;
				color: white;
				display: block;
				position: absolute;
				top: 12px;
				left: 7%;
				font-size: 2.5em;
				text-shadow: 1px 2px 0 $dark-orange;

				@include ease(333ms);
			}
		}

		// Fields
		input[type="text"],
		textarea {
			border: none;
			background: $field-color;
			width: 100% - $hover-label-width - $placeholder-bumper;
			margin: 0;
			padding: $label-padding 0;
			padding-left: $hover-label-width + $placeholder-bumper;
			color: $blue;
			font-size: 1.4em;
			letter-spacing: 0.05em;
			text-transform: uppercase;

			&#msg {
				height: 18px;
				resize: none;
				@include ease(333ms);
			}

			// Focus and JS Toggle Class
			&:focus,
			&.focused {
				outline: none;

				&#msg {
					padding-bottom: 150px;
				}

				+ label {
					width: $hover-label-width;
					background: $orange;
					color: $blue;
				}
			}

			// JS Toggle Class
			&.focused {
				+ label {
					color: $orange;
				}
			}
		}

		// Field Hover
		&:hover {
			label {
				width: $hover-label-width;
				background: $blue;
				color: white;
			}
		}
	}

	// Submit Button
	input[type="submit"] {
		background: $orange;
		color: white;
		-webkit-appearance: none;
		border: none;
		text-transform: uppercase;
		position: relative;
